<!doctype html>
<html>
<head>
    <meta charset="utf-8">
    <title>Harbor&trade; by VMware&reg;</title>
    <base href="/harbor/cn/">
    <meta name="viewport" content="width=device-width, initial-scale=1">
    <link rel="icon" type="image/x-icon" href="favicon.ico?v=2">
</head>
<body>
<my-app>Loading...</my-app>
<script type="text/javascript" src="inline.bundle.js"></script><script type="text/javascript" src="scripts.bundle.js"></script><script type="text/javascript" src="styles.bundle.js"></script><script type="text/javascript" src="vendor.bundle.js"></script><script type="text/javascript" src="main.bundle.js"></script>
<script src="https://code.jquery.com/jquery-3.2.1.min.js" integrity="sha256-hwg4gsxgFZhOsEEamdOYGBf13FyQuiTwlAQgxVSNgt4=" crossorigin="anonymous"></script>
<script>
	$(function(){
	  $.get(
	    'https://api.github.com/repos/vmware/harbor/contributors',
	     function(data){
	        var contributors = $("#contributors").siblings("p:first");
	      
	        $.each(data, function(i, e){
	          contributors.append('<a title="' + e["login"] + '" href="' + e["html_url"] + '"><img class="contributor" alt="'+ e["login"] + '" src="' + e["avatar_url"] + '"></a>');
	        });
	    },
	    'json');
	});
</script>
</body>
</html>
